import React, { useEffect, useState } from "react";
import "./ApiTeste.css";

const API_URL = "http://192.168.68.113:36147/queue";

const ApiTeste = () => {
  const [date, setDate] = useState([]);
  useEffect(() => {
    getQueue();
  }, []);
  const getQueue = async () => {
    try {
      const res = await fetch(API_URL);
      const data = await res.json();
      setDate(data.items);
      return data.items;
    } catch (error) {
      throw new Error("Error: ", error);
    }
  };
  console.clear();

  return (
    <div>
      <h2>JSON Data Table</h2>
      <table>
        <tr>
          <th>#</th>
          <th>Group</th>
          <th>Start Time</th>
          <th>Player</th>
          <th>Match</th>
          <th>Sport</th>
          <th>Channel</th>
          <th>Target</th>
          <th>Origin</th>
          <th>Type</th>
          <th>Bet ID</th>
          <th>Processed</th>
          <th>Failure Count</th>
          <th>User ID</th>
          <th>Created At</th>
          <th>Updated At</th>
          <th>__v</th>
          <th>Block Until</th>
          {date.map((item, index) => (
            <th key={index}>{item.data.group}</th>
          ))}
        </tr>
        <tr>
          <td>1</td>
          <td>1692030720000</td>
          <td>16/08/2023 05:00 AM (horário de Brasília)</td>
          <td>Benedikt Henning</td>
          <td>Benedikt Henning x Marvin Schaber</td>
          <td>Tennis</td>
          <td>pre-live</td>
          <td>1win</td>
          <td>bet-wizard</td>
          <td>who-win</td>
          <td>
            e550c9131fcd9758f2bd853c5c93b2576231976022868abbcb9b715aa02b366e
          </td>
          <td>false</td>
          <td>1</td>
          <td>marcusmot4</td>
          <td>2023-08-14T16:32:42.974Z</td>
          <td>2023-08-14T16:33:18.866Z</td>
          <td>0</td>
          <td>2023-08-14T16:33:18.865Z</td>
        </tr>
        <tr>
          <td>2</td>
          <td>1692030720000</td>
          <td>15/08/2023 08:30 AM (horário de Brasília)</td>
          <td>Chantal Sauvant</td>
          <td>Chantal Sauvant x Stefania Bojica</td>
          <td>Tennis</td>
          <td>pre-live</td>
          <td>1win</td>
          <td>bet-wizard</td>
          <td>who-win</td>
          <td>
            9ac5daf3ee01fe8c13a614af59c66b68d423a8428801204ee1f04d6ee9fa7f9c
          </td>
          <td>false</td>
          <td>10</td>
          <td>marcusmot4</td>
          <td>2023-08-14T16:32:37.772Z</td>
          <td>2023-08-14T16:32:48.805Z</td>
          <td>0</td>
          <td>2023-08-14T16:41:48.804Z</td>
        </tr>
      </table>
    </div>
  );
};

export default ApiTeste;
